import React from 'react';

function About() {
  return (
    <div className='about'>
        <p>As a professionally trained photographer and creative visual artist, my job of telling the most beautiful love stories brings me so much fulfillment and joy. I’m hard-working, yet light-hearted. I love music, movies and most of all, my adorable family. I’m powered by Intelligentsia coffee, green juices filled with crazy superfood concoctions and the thrill of my last mountain bike ride. I love luminous light, beautiful architecture and couples who are deeply in love and who care about creating a magical experience for their wedding day. What does all of this mean for you? With over nine years of experience documenting beautiful weddings around the globe, you can trust me to never miss those important details, candids and spontaneous moments. You can be sure I’ll direct you effortlessly with a guided approach, to allow for a refined, fine art look that always displays authentic emotion.</p>
        <h1>About t</h1>
    </div>
  );
};

export default About;
